const logementsUrl = 'chemin/vers/ton/fichier/logements.json';

fetch(logementsUrl)
  .then(response => response.json())
  .then(data => {
    // Stocke les données dans une variable pour les utiliser plus tard
    const logements = data;
    // Affiche les logements sous forme d'articles
    renderArticles(logements);
  });
